      </li>
      <li>
        <Link href="/about" className="link">
          About
        </Link>
      </li>
      <style jsx>{`
        ul {
          padding-left: 0;
          width: 20%;
          display: flex;
          list-style-type: none;
        }
        ul li {
          margin-right: 20px;
        }
        ul .link {
          text-decoration: none;
        }
      `}</style>
    </ul>
  );
}
export default Header;
